    [],nt"num_tags": 5,nt"name": "narrative-report-upper-mississippi-river-national-wildlife-refuge-may-august-1963",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Upper Mississippi
    River Wildlife and Fish Refuge outlines Refuge accomplishments from May to August
    of 1963. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, fish, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, vegetation
    control, prescribed burning, and wildfires. Resource management is outlined; topics
    include fur harvesting and timber removal. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, fishing,
    violations, and safety. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
